import styles from './ListItem.module.scss'

export const ListItem = ({src, title,info,options}) => {
  return (
    <div className={styles.items}>
      <img
        className={styles.img}
        src={src}
        alt={title}
      />
      <div className={styles.itemDesc}>
        <span>{title}</span>
        <span>{info}</span>
      </div>
    </div>
  )
}
